import React from 'react'
import Template from '../components/Template'

const Login = (set) => {
  return (
    <Template
        title="Welcome Back"
        desc1="Build skills for today, tomorrow, beyond."
        desc2="Education to future-proof your career."
        image={loginImg}
        formType="login"
        setIsLoggedIn={setIsLoggedIn}
    />
  )
}

export default Login
